measurements.description:
Seventy-eight striking, slightly cupped flowers and one bud on five up to 21.5-cm inflorescences; 
   sepals cream overlaid deep burgundy apical two-thirds, lateral sepal falcate;
   petals cream blotched burgundy basally, apical two-thirds deep burgundy;
   lip trilobed, cream, sidelobes heavily overlaid and striped burgundy, midlobe blotched dark burgundy, callis light yellow;
   column cream;
   substance medium; texture glossy.
